О правилах выгула собак🦮 

📌 Чтобы избежать конфликтных ситуаций и штрафов, владельцам собак нужно знать, какие места подходят для выгула питомца, а где это делать запрещено.

❗Краткий перечень правил выгула: 

🔸нельзя выгуливать собаку без поводка; если её высота в холке более 40 см, обязателен и намордник; 
🔸 нельзя выгуливать собаку на детских и спортивных площадках и прилегающих к ним территориям; 
🔸 запрещено выгуливать собаку детям до 14 лет без сопровождения взрослых; 
🔸запрещается выгуливать одновременно более одной собаки (относится к собакам высотой в холке более 40 сантиметров); 
🔸 нельзя оставлять собаку без присмотра как в общественных местах, так и в местах выгула; 
🔸 не допускается выгул собак владельцами, находящимися в состоянии алкогольного или наркотического опьянения. 

✔ При этом без поводка и намордника собака может находиться в местах, специально оборудованных для выгула и дрессировки (например, на огороженных площадках). 

📌 Также напоминаем о необходимости убирать территорию от продуктов жизнедеятельности животного.

